import axios from "axios";

export const submitHandlr = async (e, isLogin) => {
    try {
        const post = await axios.post('http://localhost:5000/users/register',
            {
                'email': 'email@email.com',
                'password': 'password1'
            },    //body or payload
            {headers: { //headers
                "Content-Type": "application/json",
            }}, 
        );

        console.log(post);
    }catch(err){    
        console.log(err);
    }
};
